<style type="text/css">
div#random ul rl.show {z-index:500;}	
div#random img {
  display: block;
  height: auto;
  max-width: 100%;
  margin-right: auto;
  margin-left: auto;
  padding-right: 40px;
}
div#randomprikol img {
  display: block;
  height: auto;
  max-width: 100%;
  margin-right: auto;
  margin-left: auto;
}

</style>
	  
<script type="text/javascript" src="http://code.jquery.com/jquery-latest.min.js"></script>
<script>
	
 $(document).ready(function() {		
            firstrotate();
        
});
 
function firstrotate() {	
 
	var current = ($('div#random ul rl.show')?  $('div#random ul rl.show') : $('div#random ul rl:first'));
 
	 var next = ((current.next().length) ? ((current.next().hasClass('show')) ? $('div#random ul rl:first') :current.next()) : $('div#random ul rl:first'));	
 
	
	 var sibs = current.siblings();
	var rndNum = Math.floor(Math.random() * sibs.length );
	 var next = $( sibs[ rndNum ] );
	 next.css({opacity: 1.0})
	 .addClass('show')
	.animate({opacity: 1.0});
        
	current.animate({opacity: 0.0})
 	.removeClass('show');
$(function() {
    $('div#random ul rl.show img:first').each(function() {
        $(this).attr('src', $(this).data('src'));    
    })
});
};
	
</script>
